import { StyledGameOverTitle } from "./GameOverWindow.styled";

export const GameOverWindow = () => {
  return (
    <ModalWindowWraper >
      <StyledGameOverTitle>GAME OVER</StyledGameOverTitle>
    </ModalWindowWraper>
  );
};
